  false,\n\t\"url\": null,\n\t\"notes\": \"The Rio Grande cutthroat trout (Oncorhynchus
  clarkii virginalis) lives in high elevation, coldwater streams in New Mexico and
  southern Colorado. It is a subspecies that was made a candidate for listing in 2008
  by the U. S. Fish and Wildlife Service (Service) under the Endangered Species Act
  of 1973, as amended (Act) (73 FR 27900, May 14, 2008). It is now being reviewed
  for listing as a threatened or endangered species under the Act. This Rio Grande
  cutthroat trout Species Status Assessment Report (SSA Report) is a summary of the
  information assembled and reviewed by the Service and incorporates the best scientific
  and commercial data available. This SSA Report documents the results of the comprehensive
  status review for the Rio Grande cutthroat trout.\",\n\t\"license_title\": \"License
